import oMarker from './images/icon-o.svg';
import xMarker from './images/icon-x.svg';
const Navbar = ({currentPlayer, onClick}) => {
  return (
    <div>
      <div>
        <img src= {oMarker} alt="" ></img>
        <img src= {xMarker} alt="" ></img>
      </div>
      <div>
        <p> {currentPlayer}'s turn</p>
      <img src= {
        currentPlayer === 'O' ? oMarker : xMarker
      } alt= {currentPlayer} ></img>
      </div>
      <button onClick={onClick}>Next</button>
      <p>Turn</p>
      <p>Reset</p>
    </div>
  )
};

export default Navbar;
